Cast: Brooklyn Lee, Charles Dera, Evan Stone, Kayden Kross, Lela Star, Erik Everhard

A weekend getaway with close friends takes a tumultuous turn as a loving married couple toys with the boundaries of betrayal. Beautiful Kayden Kross is a loving wife, happily married to her husband, ready for a few days to reconnect and unwind. An innocent conversation leads to a hated exploration of the boundaries of marriage, and the limits of the heart. When a seductive invitation to engage in an explicit affair is accepted, can their love save what remains in the aftermath of ruthless betrayal?
